class StandardObjectWidget(QWidget):
    def __init__(self, screen_width, screen_height, parent):
        super(StandardObjectWidget, self).__init__(parent)
        self.rootDir = os.getcwd()
        self.libDir = os.path.join(self.rootDir, "Library")

        self.screen_width = screen_width
        self.screen_height = screen_height

        # Scale text to screen size
        self.text_size1 = str(int(self.screen_width * 0.0100 * 1.5)) + 'px'
        self.text_size2 = str(int(self.screen_width * 0.0125 * 1.5)) + 'px'
        self.text_size3 = str(int(self.screen_width * 0.0075 * 1.5)) + 'px'


