class MainWindow(StandardMainWindow):
    def __init__(self):
        super(MainWindow, self).__init__('JLI Vision Robot GUI')

        self.img_src_display = QLabel(self)
        init_frame = np.zeros((600, 960), dtype=np.uint8)
        frame_height, frame_width = init_frame.shape
        image = QImage(init_frame.data, frame_width, frame_height, init_frame.strides[0], QImage.Format_Grayscale8)
        self.img_src_display.setPixmap(QPixmap.fromImage(image))

        self.properties = MainObjectWidget(self.screen_width, self.screen_height, self)
        self.splitter.addWidget(self.properties)
        self.splitter.addWidget(self.img_src_display)

        self.properties.signal_start.connect(self.startRobotTask)
        self.properties.signal_stop.connect(self.stopRobotTask)
        self.properties.signal_exit.connect(self.closeEvent)
        # self.properties.signal_start_capture.connect(self.startCapture)
        # self.properties.signal_stop_capture.connect(self.stopCapture)
        # self.properties.combo1.currentIndexChanged.connect(self.update_lookup)
        # self.properties.camera.currentIndexChanged.connect(self.update_cam)
        # self.properties.button_replace.clicked.connect(self.replae_objets)
        # self.properties.signal_pick.connect(lambda: self.update_pick_list(True))

        # self.keyPressEvent = self.MainKeyPressEvent
        # self.keyReleaseEvent = self.MainKeyReleaseEvent
        # self.mousePressEvent = self.MainMousePressEvent

        # Make components start:
        self.StopImageTaskEvent = Event()
        ImageThreadArgList = [self.manager.grabImage, self.StopImageTaskEvent]
        ContinuousImagesThread = Thread(target=self.updateImageView, args=ImageThreadArgList, daemon=True, name='Async Images')
        ContinuousImagesThread.start()
        # Wait until the first image is available:
        self.manager.ImageAvailable.wait(1.0)

    def updateImageView(self, get_image_handle, stop_event):
        while not stop_event.isSet():
            try:  # See if there is a new image
                image, info, cam_num = get_image_handle()
                if image is None:
                    continue
            except Exception as e:
                communicateError(e)
                continue

            try:
                im_shape = image.shape
                if len(im_shape) == 2:
                    height, width = im_shape
                    image = QImage(image, width, height, QImage.Format_Grayscale8)
                elif len(im_shape) == 3:
                    height, width, c = im_shape
                    image = QImage(image, width, height, QImage.Format_RGB888)
                else:
                    continue

                self.img_src_display.setPixmap(QPixmap.fromImage(image).scaled(width/2, height/2, QtCore.Qt.KeepAspectRatio))
                self.img_src_display.show()
            except Exception as e:
                communicateError(e)

    def startRobotTask(self):
        self.manager.startRobotTask()

    def stopRobotTask(self):
        self.manager.stopRobotTask()

    def keyPressEvent(self, event):
        if event.key() == QtCore.Qt.Key_Escape:
            self.close()

    def closeEvent(self, event):
        try:
            self.StopImageTaskEvent.set()
            self.manager.shutdownSafely()
            self.close()
        except Exception as e:
            communicateError(e, "An unforeseen exception occurred when exiting the application.")


